"use strict";(self.webpackChunkblog=self.webpackChunkblog||[]).push([[26260],{1947:(a,e,i)=>{i.r(e),i.d(e,{default:()=>c});var n=i(78e3);const t=[(0,n.uE)('<p>Las distribuciones contables son utilizadas para realizar un reparto del valor monetario de una operación administrativa en cuentas contables específicas, dicho de otra manera, esta metodología permite distribuir porcentualmente el monto de un documento en diferentes cuentas de manera estructurada.</p><p>La forma en la que Solop ERP ha diseñado esta funcionalidad, le permitirá estructurar la manera en la que desea sea distribuido el importe, y los filtros, de esta forma usted tiene la oportunidad de definir un patrón para aplicar sus distribuciones contables. Sin embargo, para comprender mejor esta funcionalidad veamos el siguiente ejemplo:</p><p>Imaginemos una empresa que recibe un documento por pagar por concepto de consumo eléctrico, este está definido como un cargo en la factura, el resultado predeterminado será el siguiente:</p><table><thead><tr><th>Cuenta</th><th>Débito</th><th>Crédito</th></tr></thead><tbody><tr><td>Gasto Eléctrico</td><td>2.500.000</td><td></td></tr><tr><td>Cuentas por Pagar</td><td></td><td>2.500.000</td></tr><tr><td>Total</td><td>2.500.000</td><td>2.500.000</td></tr></tbody></table><p>Para este caso la empresa requiere distribuir un 60% del consumo eléctrico al costo de producción y un 40% a la cuenta de gasto común, quedando el asiento de la distribución de la siguiente manera:</p><table><thead><tr><th>Cuenta</th><th>Débito</th><th>Crédito</th></tr></thead><tbody><tr><td>Gasto Eléctrico</td><td>1.000.000</td><td></td></tr><tr><td>Costo Eléctrico</td><td>1.500.000</td><td></td></tr><tr><td>Cuentas por Pagar</td><td></td><td>2.500.000</td></tr><tr><td>Total</td><td>2.500.000</td><td>2.500.000</td></tr></tbody></table><p>El ejemplo anterior define de manera gráfica a que se refiere una distribución contable, ahora bien, Solop ERP le ofrece la oportunidad de establecer un comportamiento para que estas distribuciones sean ejecutadas de forma automática al ejecutar cualquier documento.</p><p>Con esta funcionalidad usted podŕa definir en qué tipos de documentos, Tipo de Aplicación, e inclusive un rango de fecha en la que desea ejecutar la distribución. Esta última para los casos en los que la distribución es ejecutada de manera excepcional y por ende tiene fecha de vigencia.</p><p>Además, puede definir los filtros para la ejecución, estableciendo si desea que su distribución sea aplicada a una organización, cuenta, actividad, producto, socio de negocio, o elementos de usuarios activos en especifico, o si por el contrario usted desea que su aplicación sea general.</p><p>El ejemplo expuesto fue bastante claro, pero también muy sencillo, y por supuesto no podíamos llegar hasta allí. Como hemos visto en el documento: Dimensiones Contables, Solop ERP maneja múltiples dimensiones que permiten medir y reportar desempeño desde los resultados transaccionales. Por tanto, las dimensiones no pueden dejar de ser fusionadas con las distribuciones.</p><p>Para ello, es permitido decidir que dimensiones desea sean sobreescritas al ejecutar la distribución, transfiriendo un porcentaje del monto de la transacción, o bien, podría establecer un monto fijo (débito o crédito) para distribuir.</p><p>Por otra parte, ¿recuerda usted el Tipo de Aplicación?, pues sí, también puede sobreescribir la aplicación contable, transfiriendo el importe distribuido a uno o varios tipos de aplicación.</p><p>Para que pueda conocer cómo y cuándo usar esta funcionalidad Solop ERP ha estructurado un material, basado en la gama de opciones disponibles para establecer un patrón de comportamiento al ejecutar las distribuciones.</p><ul><li>Registro de Distribución Contable</li><li>Distribución Contable</li><li>Línea</li><li>Consulta de Distribución Contable Aplicada</li></ul><h2 id="registro-de-distribucion-contable" tabindex="-1"><a class="header-anchor" href="#registro-de-distribucion-contable" aria-hidden="true">#</a> Registro de Distribución Contable</h2><p>Para ejemplificar el procedimiento de distribución contable, se tiene el documento por pagar <strong>1000110</strong> con monto total de <strong>2.500.000,00</strong>.</p><p><img src="/assets/img/docs/accounting-management/acm-accounting-image410.png" alt="Campo"></p><p>Imagen 1. Factura por Pagar</p><p>Ubique y seleccione en el menú de Solop ERP, la carpeta <strong>Análisis de Desempeño</strong>, luego seleccione la carpeta <strong>Reglas Contables</strong>, por último seleccione la ventana <strong>Distribución Contable</strong>.</p><p><img src="/assets/img/docs/accounting-management/acm-accounting-image411.png" alt="Campo"></p><p>Imagen 2. Menú de Solop ERP</p><h2 id="distribucion-contable" tabindex="-1"><a class="header-anchor" href="#distribucion-contable" aria-hidden="true">#</a> Distribución Contable</h2><p>Podrá visualizar la carpeta <strong>Distribución Contable</strong>, con los diferentes registros de distribución que se encuentran en Solop ERP.</p><p><img src="/assets/img/docs/accounting-management/acm-accounting-image412.png" alt="Campo"></p><p>Imagen 3. Ventana Distribución Contable</p><p>Seleccione el icono <strong>Registro Nuevo</strong>, ubicado en la barra de herramientas de Solop ERP, para crear un nuevo registro de distribución.</p><p><img src="/assets/img/docs/accounting-management/acm-accounting-image413.png" alt="Campo"></p><p>Imagen 4. Icono Registro Nuevo de la Ventana Distribución Contable</p><p>Seleccione en el campo <strong>Organización</strong>, la organización para la cual esta realizando la distribución.</p><p><img src="/assets/img/docs/accounting-management/acm-accounting-image414.png" alt="Campo"></p><p>Imagen 5. Campo Organización de la Ventana Distribución Contable</p><p>Introduzca en el campo <strong>Nombre</strong>, el nombre de referencia correspondiente al registro de distribución que esta realizando.</p><p><img src="/assets/img/docs/accounting-management/acm-accounting-image415.png" alt="Campo"></p><p>Imagen 6. Campo Nombre de la Ventana Distribución Contable</p><p>Introduzca en el campo <strong>Descripción</strong>, una breve descripción correspondiente al registro de distribución que esta realizando.</p><p><img src="/assets/img/docs/accounting-management/acm-accounting-image416.png" alt="Campo"></p><p>Imagen 7. Campo Descripción de la Ventana Distribución Contable</p><p>Seleccione en el campo <strong>Esquema Contable</strong>, el esquema que será utilizado para la distribución que esta realizando.</p><p><img src="/assets/img/docs/accounting-management/acm-accounting-image417.png" alt="Campo"></p><p>Imagen 8. Campo Esquema Contable de la Ventana Distribución Contable</p><p>El checklist <strong>Crear Reversión</strong>, indica que el movimiento de reversión se creará.</p><p><img src="/assets/img/docs/accounting-management/acm-accounting-image418.png" alt="Campo"></p><p>Imagen 9. Checklist Crear Reversión de la Ventana Distribución Contable</p><p>Warning</p><p>Si se inhabilita el checklist, el movimiento original será borrado.</p><p>Seleccione en el campo <strong>Tipo de Aplicación</strong>, el tipo de aplicación que será utilizado para la distribución que esta realizando.</p><p><img src="/assets/img/docs/accounting-management/acm-accounting-image419.png" alt="Campo"></p><p>Imagen 10. Campo Tipo de Aplicación de la Ventana Distribución Contable</p><p>Seleccione el tipo de documento en el campo <strong>Tipo de Documento</strong>, la selección de este define el comportamiento del documento que se esta elaborando, dicho comportamiento se encuentra explicado en el documento Tipo de Documento elaborado por Solop ERP.</p><p><img src="/assets/img/docs/accounting-management/acm-accounting-image420.png" alt="Campo"></p><p>Imagen 11. Campo Tipo de Documento de la Ventana Distribución Contable</p><p>Seleccione en el campo <strong>Válido Desde</strong>, la fecha de inicio de la distribución que esta realizando.</p><p><img src="/assets/img/docs/accounting-management/acm-accounting-image421.png" alt="Campo"></p><p>Imagen 12. Campo Válido Desde de la Ventana Distribución Contable</p><p>Seleccione en el campo <strong>Válido Hasta</strong>, la fecha de finalización de la distribución que esta realizando.</p><p><img src="/assets/img/docs/accounting-management/acm-accounting-image422.png" alt="Campo"></p><p>Imagen 13. Campo Válido Hasta de la Ventana Distribución Contable</p><p>El checklist <strong>Cualquier Organización</strong>, al estar tildado aplica la distribución contable a todas las organizaciones.</p><p><img src="/assets/img/docs/accounting-management/acm-accounting-image423.png" alt="Campo"></p><p>Imagen 14. Checklist Cualquier Organización de la Ventana Distribución Contable</p><p>Al destildar el checklist <strong>Cualquier Organización</strong>, se habilita el campo <strong>Organización</strong> para aplicar la distribución contable sólo a la organización que sea seleccionada en dicho campo.</p><p><img src="/assets/img/docs/accounting-management/acm-accounting-image424.png" alt="Campo"></p><p>Imagen 15. Campo Organización del Checklist Cualquier Organización de la Ventana Distribución Contable</p><p>El checklist <strong>Cualquier Cuenta</strong>, al estar tildado aplica la distribución contable a todas las cuentas.</p><p><img src="/assets/img/docs/accounting-management/acm-accounting-image425.png" alt="Campo"></p><p>Imagen 16. Checklist Cualquier Cuenta de la Ventana Distribución Contable</p><p>Al destildar el checklist <strong>Cualquier Cuenta</strong>, se habilita el campo <strong>Cuenta</strong> para aplicar la distribución contable sólo a la cuenta que sea seleccionada en dicho campo.</p><p><img src="/assets/img/docs/accounting-management/acm-accounting-image426.png" alt="Campo"></p><p>Imagen 17. Campo Cuenta del Checklist Cualquier Cuenta de la Ventana Distribución Contable</p><p>El checklist <strong>Cualquier Actividad</strong>, al estar tildado aplica la distribución contable a todas las actividades.</p><p><img src="/assets/img/docs/accounting-management/acm-accounting-image427.png" alt="Campo"></p><p>Imagen 18. Checklist Cualquier Actividad de la Ventana Distribución Contable</p><p>Al destildar el checklist <strong>Cualquier Actividad</strong>, se habilita el campo <strong>Actividad</strong> para aplicar la distribución contable sólo a la actividad que sea seleccionada en dicho campo.</p><p><img src="/assets/img/docs/accounting-management/acm-accounting-image428.png" alt="Campo"></p><p>Imagen 19. Campo Actividad del Checklist Cualquier Actividad de la Ventana Distribución Contable</p><p>El checklist <strong>Cualquier Producto</strong>, al estar tildado aplica la distribución contable a todos los productos.</p><p><img src="/assets/img/docs/accounting-management/acm-accounting-image429.png" alt="Campo"></p><p>Imagen 20. Checklist Cualquier Producto de la Ventana Distribución Contable</p><p>Al destildar el checklist <strong>Cualquier Producto</strong>, se habilita el campo <strong>Producto</strong> para aplicar la distribución contable sólo al producto que sea seleccionado en dicho campo.</p><p><img src="/assets/img/docs/accounting-management/acm-accounting-image430.png" alt="Campo"></p><p>Imagen 21. Campo Producto del Checklist Cualquier Producto de la Ventana Distribución Contable</p><p>El checklist <strong>Cualquier Socio del Negocio</strong>, al estar tildado aplica la distribución contable a todos los socios del negocio.</p><p><img src="/assets/img/docs/accounting-management/acm-accounting-image431.png" alt="Campo"></p><p>Imagen 22. Checklist Cualquier Socio del Negocio de la Ventana Distribución Contable</p><p>Al destildar el checklist <strong>Cualquier Socio del Negocio</strong>, se habilita el campo <strong>Socio del Negocio</strong> para aplicar la distribución contable sólo al socio del negocio que sea seleccionado en dicho campo.</p><p><img src="/assets/img/docs/accounting-management/acm-accounting-image432.png" alt="Campo"></p><p>Imagen 23. Campo Socio del Negocio del Checklist Cualquier Socio del Negocio de la Ventana Distribución Contable</p><p>El checklist <strong>Cualquier Usuario 1</strong>,</p><p><img src="/assets/img/docs/accounting-management/acm-accounting-image433.png" alt="Campo"></p><p>Imagen 24. Checklist Cualquier Usuario 1 de la Ventana Distribución Contable</p><p>Al destildar el checklist <strong>Cualquier Usuario 1</strong>, se habilita el campo <strong>Centro de Costos</strong> para aplicar la distribución contable sólo al centro de costos que sea seleccionado en dicho campo.</p><p><img src="/assets/img/docs/accounting-management/acm-accounting-image434.png" alt="Campo"></p><p>Imagen 25. Campo Centro de Costos del Checklist Cualquier Usuario 1 de la Ventana Distribución Contable</p><p>Note</p><p>Recuerde guardar el registro de los campos de la pestaña antes de posicionarse en otra pestaña de la misma ventana, seleccionando el icono <strong>Guardar Cambios</strong> ubicado en la barra de herramientas de Solop ERP.</p><h2 id="linea" tabindex="-1"><a class="header-anchor" href="#linea" aria-hidden="true">#</a> Línea</h2><p>Seleccione la pestaña <strong>Línea</strong>, para crear los registros de distribución requeridos.</p><p><img src="/assets/img/docs/accounting-management/acm-accounting-image435.png" alt="Campo"></p><p>Imagen 26. Pestaña Línea de la Ventana Distribución Contable</p><p>Introduzca en el campo <strong>Descripción</strong>, una breve descripción correspondiente al registro de porcentaje de distribución que esta realizando.</p><p><img src="/assets/img/docs/accounting-management/acm-accounting-image436.png" alt="Campo"></p><p>Imagen 27. Campo Descripción de la Pestaña Línea de la Ventana Distribución Contable</p><p>Introduzca en el campo <strong>Porcentaje</strong>, el porcentaje de distribución correspondiente al registro que esta realizando.</p><p><img src="/assets/img/docs/accounting-management/acm-accounting-image437.png" alt="Campo"></p><p>Imagen 28. Campo Porcentaje de la Pestaña Línea de la Ventana Distribución Contable</p><p>Introduzca en el campo <strong>Débito Contabilizado</strong>, el monto de débito contabilizado correspondiente al registro que esta realizando.</p><p><img src="/assets/img/docs/accounting-management/acm-accounting-image438.png" alt="Campo"></p><p>Imagen 29. Campo Débito Contabilizado de la Pestaña Línea de la Ventana Distribución Contable</p><p>Introduzca en el campo <strong>Crédito Contabilizado</strong>, el monto de crédito contabilizado correspondiente al registro que esta realizando.</p><p><img src="/assets/img/docs/accounting-management/acm-accounting-image439.png" alt="Campo"></p><p>Imagen 30. Campo Crédito Contabilizado de la Pestaña Línea de la Ventana Distribución Contable</p><p>El checklist <strong>Signo de cuenta invertida</strong>,</p><p><img src="/assets/img/docs/accounting-management/acm-accounting-image440.png" alt="Campo"></p><p>Imagen 31. Checklist Signo de Cuenta Invertida de la Pestaña Línea de la Ventana Distribución Contable</p><p>Note</p><p>Al seleccionar el checklist <strong>Signo de cuenta invertida</strong>, no se habilita ningún campo.</p><p>El checklist <strong>Sobrescribir tipo de publicación</strong>, Sobreescribe el tipo de publicación con el valor especificado.</p><p><img src="/assets/img/docs/accounting-management/acm-accounting-image441.png" alt="Campo"></p><p>Imagen 32. Checklist Sobrescribir Tipo de Publicación de la Pestaña Línea de la Ventana Distribución Contable</p><p>Al seleccionar el checklist <strong>Sobrescribir tipo de publicación</strong>, se habilita el campo <strong>Tipo de Aplicación</strong> para aplicar la distribución contable sólo al tipo de aplicación que sea seleccionada en dicho campo.</p><p><img src="/assets/img/docs/accounting-management/acm-accounting-image442.png" alt="Campo"></p><p>Imagen 33. Campo Tipo de Aplicación del Checklist Sobrescribir Tipo de Publicación de la Pestaña Línea de la Ventana Distribución Contable</p><p>El checklist <strong>Sobreescribe Organización</strong>, aplica la distribución contable a todas las organizaciones.</p><p><img src="/assets/img/docs/accounting-management/acm-accounting-image443.png" alt="Campo"></p><p>Imagen 34. Checklist Sobreescribe Organización de la Pestaña Línea de la Ventana Distribución Contable</p><p>Al seleccionar el checklist <strong>Sobreescribe Organización</strong>, se habilita el campo <strong>Organización</strong> para aplicar la distribución contable sólo a la organización que sea seleccionada en dicho campo.</p><p><img src="/assets/img/docs/accounting-management/acm-accounting-image444.png" alt="Campo"></p><p>Imagen 35. Campo Organización del Checklist Sobreescribe Organización de la Pestaña Línea de la Ventana Distribución Contable</p><p>El checklist <strong>Sobreescribe la cuenta</strong>, aplica la distribución contable a todas las cuentas.</p><p><img src="/assets/img/docs/accounting-management/acm-accounting-image445.png" alt="Campo"></p><p>Imagen 36. Checklist Sobreescribe la Cuenta de la Pestaña Línea de la Ventana Distribución Contable</p><p>Al seleccionar el checklist <strong>Sobreescribe la cuenta</strong>, se habilita el campo <strong>Cuenta</strong> para aplicar la distribución contable sólo a la cuenta que sea seleccionada en dicho campo.</p><p><img src="/assets/img/docs/accounting-management/acm-accounting-image446.png" alt="Campo"></p><p>Imagen 37. Campo Cuenta del Checklist Sobreescribe la Cuenta de la Pestaña Línea de la Ventana Distribución Contable</p><p>El checklist <strong>Sobreescribe la Actividad</strong>, aplica la distribución contable a todas las actividades.</p><p><img src="/assets/img/docs/accounting-management/acm-accounting-image447.png" alt="Campo"></p><p>Imagen 38. Checklist Sobreescribe la Actividad de la Pestaña Línea de la Ventana Distribución Contable</p><p>Al seleccionar el checklist <strong>Sobreescribe la Actividad</strong>, se habilita el campo <strong>Actividad</strong> para aplicar la distribución contable sólo a la actividad que sea seleccionada en dicho campo.</p><p><img src="/assets/img/docs/accounting-management/acm-accounting-image448.png" alt="Campo"></p><p>Imagen 39. Campo Actividad del Checklist Sobreescribe la Actividad de la Pestaña Línea de la Ventana Distribución Contable</p><p>El checklist <strong>Sobreescribe Producto</strong>, aplica la distribución contable a todos los productos.</p><p><img src="/assets/img/docs/accounting-management/acm-accounting-image449.png" alt="Campo"></p><p>Imagen 40. Checklist Sobreescribe Producto de la Pestaña Línea de la Ventana Distribución Contable</p><p>Al seleccionar el checklist <strong>Sobreescribe Producto</strong>, se habilita el campo <strong>Producto</strong> para aplicar la distribución contable sólo al producto que sea seleccionado en dicho campo.</p><p><img src="/assets/img/docs/accounting-management/acm-accounting-image450.png" alt="Campo"></p><p>Imagen 41. Campo Producto del Checklist Sobreescribe Producto de la Pestaña Línea de la Ventana Distribución Contable</p><p>El checklist <strong>Sobreescribe Socio del Negocio</strong>, aplica la distribución contable a todos los socios del negocio.</p><p><img src="/assets/img/docs/accounting-management/acm-accounting-image451.png" alt="Campo"></p><p>Imagen 42. Checklist Sobreescribe Socio del Negocio de la Pestaña Línea de la Ventana Distribución Contable</p><p>Al seleccionar el checklist <strong>Sobreescribe Socio del Negocio</strong>, se habilita el campo <strong>Socio del Negocio</strong> para aplicar la distribución contable sólo al socio del negocio que sea seleccionado en dicho campo.</p><p><img src="/assets/img/docs/accounting-management/acm-accounting-image452.png" alt="Campo"></p><p>Imagen 43. Campo Socio del Negocio del Checklist Sobreescribe Socio del Negocio de la Pestaña Línea de la Ventana Distribución Contable</p><p>El checklist <strong>Sobreescribe Usuario 1</strong>,</p><p><img src="/assets/img/docs/accounting-management/acm-accounting-image453.png" alt="Campo"></p><p>Imagen 44. Checklist Sobreescribe Usuario 1 de la Pestaña Línea de la Ventana Distribución Contable</p><p>Al seleccionar el checklist <strong>Sobreescribe Usuario 1</strong>, se habilita el campo <strong>Centro de Costos</strong> para aplicar la distribución contable sólo al centro de costos que sea seleccionado en dicho campo.</p><p><img src="/assets/img/docs/accounting-management/acm-accounting-image454.png" alt="Campo"></p><p>Imagen 45. Campo Centro de Costos del Checklist Sobreescribe Usuario 1 de la Pestaña Línea de la Ventana Distribución Contable</p><p>El checklist <strong>Sobreescribe Usuario 3</strong>,</p><p><img src="/assets/img/docs/accounting-management/acm-accounting-image455.png" alt="Campo"></p><p>Imagen 46. Checklist Sobreescribe Usuario 3 de la Pestaña Línea de la Ventana Distribución Contable</p><p>Note</p><p>Al seleccionar el checklist <strong>Sobreescribe Usuario 3</strong>, no se habilita ningún campo.</p><p>El checklist <strong>Sobreescribe Usuario 4</strong>,</p><p><img src="/assets/img/docs/accounting-management/acm-accounting-image456.png" alt="Campo"></p><p>Imagen 47. Checklist Sobreescribe Usuario 4 de la Pestaña Línea de la Ventana Distribución Contable</p><p>Note</p><p>Al seleccionar el checklist <strong>Sobreescribe Usuario 4</strong>, no se habilita ningún campo.</p><p>Regrese a la pestaña <strong>Distribución</strong> y ubique el campo <strong>Porcentaje Total</strong>, ubicado en la parte inferior izquierda de la misma. En este campo podrá visualizar el porcentaje total de todas las distribuciones definidas en cada uno de los registros de la pestaña <strong>Línea</strong>.</p><p><img src="/assets/img/docs/accounting-management/acm-accounting-image457.png" alt="Campo"></p><p>Imagen 48. Pestaña Distribución Contable y Campo Porcentaje Total</p><h2 id="consulta-de-distribucion-contable-aplicada" tabindex="-1"><a class="header-anchor" href="#consulta-de-distribucion-contable-aplicada" aria-hidden="true">#</a> Consulta de Distribución Contable Aplicada</h2><p>Ubique la factura por pagar <strong>1000110</strong> con monto total de <strong>2.500.000,00</strong>, expuesta anteriormente al principio del presente material y seleccione la opción <strong>Contabilizado</strong> ubicado en la parte inferior de la ventana <strong>Documento por Pagar</strong>.</p><p><img src="/assets/img/docs/accounting-management/acm-accounting-image458.png" alt="Campo"></p><p>Imagen 49. Opción Contabilizado de la Factura por Pagar</p><p>Podrá visualizar el asiento de la distribución de la siguiente manera</p><p><img src="/assets/img/docs/accounting-management/acm-accounting-image459.png" alt="Campo"></p><p>Imagen 50. Asiento Contable de Distribución</p>',178)],o={},c=(0,i(13860).Z)(o,[["render",function(a,e){return(0,n.wg)(),(0,n.iD)("div",null,t)}]])},40480:(a,e,i)=>{i.r(e),i.d(e,{data:()=>n});const n=JSON.parse('{"key":"v-c08d3034","path":"/docs/accounting-management/distribution.html","title":"Distribución Contable","lang":"es-ES","frontmatter":{"title":"Distribución Contable","category":["Documentation"],"star":9,"sticky":9,"article":false,"summary":"Las distribuciones contables son utilizadas para realizar un reparto del valor monetario de una operación administrativa en cuentas contables específicas, dicho de otra manera, est","head":[["meta",{"property":"og:url","content":"https://ayuda.solopapp.com/docs/accounting-management/distribution.html"}],["meta",{"property":"og:title","content":"Distribución Contable"}],["meta",{"property":"og:type","content":"article"}],["meta",{"property":"og:updated_time","content":"2023-08-01T14:33:06.000Z"}],["meta",{"property":"og:locale","content":"es-ES"}],["meta",{"property":"article:modified_time","content":"2023-08-01T14:33:06.000Z"}]]},"excerpt":"","headers":[{"level":2,"title":"Registro de Distribución Contable","slug":"registro-de-distribucion-contable","children":[]},{"level":2,"title":"Distribución Contable","slug":"distribucion-contable","children":[]},{"level":2,"title":"Línea","slug":"linea","children":[]},{"level":2,"title":"Consulta de Distribución Contable Aplicada","slug":"consulta-de-distribucion-contable-aplicada","children":[]}],"git":{"createdTime":1678314887000,"updatedTime":1690900386000,"contributors":[{"name":"markinpadilla","email":"mjpc27@gmail.com","commits":5},{"name":"mgarciaQ76","email":"139590879+mgarciaQ76@users.noreply.github.com","commits":2},{"name":"yamelsenih","email":"ysenih@erpya.com","commits":1}]},"readingTime":{"minutes":8.94,"words":2683},"filePathRelative":"docs/accounting-management/distribution.md","localizedDate":"8 de marzo de 2023"}')}}]);